;(function () {
    // tooltip
    $('[data-toggle="tooltip"]').tooltip();
    // 
    // moment.lang('zh-cn');
    // 
    $('.timeago').each(function () {
        var time_str = $(this).text();
        if (moment(time_str, "YYYY-MM-DD HH:mm:ss", true).isValid()) {
            $(this).text(moment(time_str).fromNow());
        }
        // $(this).addClass('popover-with-html');
        $(this).attr('data-original-title', time_str);
    });
    // 
    $('#question').on('click', function () {
        layer.open({
            title: ''
            , content: 'layer'
        });
    });
    // 
    $('#logout').on('click', function () {
        layer.confirm('?', {
            icon: 3, title: ''
        }, function (index) {
            $('#logout-form').submit();
            layer.close(index);
        });
    });
    // 
    console.log('\n' +
        '\n' +
        '%c&', "color:red");
    // HTML5
    $('form').attr('novalidate', '');
    // 
    $('#user-edit-form').bootstrapValidator({
        fields: {
            password: {
                validators: {
                    notEmpty: {
                        message: ''
                    },
                    stringLength: {
                        min: 6,
                        max: 20,
                        message: '%s%s'
                    }
                }
            },
            new_password: {
                validators: {
                    notEmpty: {
                        message: ''
                    },
                    stringLength: {
                        min: 6,
                        max: 20,
                        message: '%s%s'
                    }
                }
            },
            new_password_confirmation: {
                validators: {
                    notEmpty: {
                        message: ''
                    },
                    identical: {
                        field: 'new_password',
                        message: ''
                    }
                }
            }
        }
    });
    // 
    $('#cool-create-form').bootstrapValidator({
        fields: {
            name: {
                validators: {
                    notEmpty: {
                        message: ''
                    },
                    stringLength: {
                        min: 2,
                        message: '%s'
                    }
                }
            },
            url: {
                validators: {
                    notEmpty: {
                        message: 'URL'
                    },
                    uri: {
                        message: 'URL'
                    }
                }
            },
            description: {
                validators: {
                    notEmpty: {
                        message: ''
                    },
                    stringLength: {
                        min: 5,
                        message: '%s'
                    }
                }
            },
            img_url: {
                validators: {
                    notEmpty: {
                        message: '',
                    },
                    file: {
                        extension: 'jpg,jpeg,png',
                        type: 'image/jpeg,image/jpeg,image/png',
                        message: ':jpg,jpeg,png'
                    }
                }
            }
        }
    });
    // 
    $("#input-path").change(function () {
        $("#docPath").val($(":file").val());
    });
    // 
    $('#sign').on('click', function () {
        $.ajax({
            url: '/sign',
            success: function (data, textStatus, jqXHR) {
                if (textStatus == 'success') {
                    layer.msg(data.message);
                }
            },
            error: function (xhr, textStatus, error) {
                if (error == 'Unauthorized') {
                    layer.msg('');
                    location.href = '/auth/login';
                }
            }
        });
    });
})();
